import React, { useState, useEffect } from 'react';
import './Form.scss';

export default function Form({ fields, url }) {
    const [formState, setFormState] = useState([]);
    useEffect(() => {
        setFormState([...fields]);
    }, []);
    const onSubmit = (e) => {
        e.preventDefault();
    };
    console.log(fields), formState;
    return <form onSubmit={onSubmit} className='form'></form>;
}
